import { ACTIONS } from './App.js'

export default function DigitButton({ dispatch, operation}) {
  return (
    <button
      onclick={() => dispatch({ type: ACTIONS.CHOOSE_OPERATION, payload: { operation } })}>
        {operation}
    </button>
  )
}
